import React from "react";

function header() {
  return (
    <div class="main">
  <div class="top half">
    <img src="https://i.amz.mshcdn.com/SCUZjhWgQ8eXizezmQvz7nCngKE=/950x534/filters:quality(90)/https%3A%2F%2Fblueprint-api-production.s3.amazonaws.com%2Fuploads%2Fcard%2Fimage%2F901579%2Fcb98a6b9-ad1d-4ecc-b614-40101ac59dd9.png" />
  </div>
  <div class="bottom half">
    <img src="https://i.amz.mshcdn.com/SCUZjhWgQ8eXizezmQvz7nCngKE=/950x534/filters:quality(90)/https%3A%2F%2Fblueprint-api-production.s3.amazonaws.com%2Fuploads%2Fcard%2Fimage%2F901579%2Fcb98a6b9-ad1d-4ecc-b614-40101ac59dd9.png" />
  </div>
  <button class="super-button">Enter</button>
  <div class="overlay"></div>
  <div class="button-line left">
    <div class="inner"></div>
  </div>
  <div class="button-line right">
    <div class="inner"></div>
  </div>
</div>
  );
}

export default header;
